            new RefFinancialAccountBalanceSheetCode { Id=Guid.Parse("fde89476-85c7-4f20-975e-b46057f8d804"), Code="211", Description="Land and Land Improvements", Definition="A capital asset account that reflects the acquisition value of land owned by a school district. If land is purchased, this account includes the purchase price and costs such as legal fees, filling and excavation costs, and other associated improvement costs incurred to put the land in condition for its intended use. If land is acquired by gift, the account reflects its fair value at the time of acquisition. Permanent improvements to land, such as grading and fill, should also be accounted for in this account. Land and land improvements are considered nonexhaustible assets owing to their significantly long expected useful life. Nonexhaustible assets are not to be depreciated. Therefore, assets classified by asset code 211 should result in no depreciation expense.", SortOrder=Convert.ToDecimal("28.00") },
            new RefFinancialAccountBalanceSheetCode { Id=Guid.Parse("00f1d0b4-da5d-4e54-9b4e-bbe51ddc21a3"), Code="221", Description="Site Improvements", Definition="A capital asset account that reflects the value of nonpermanent improvements to building sites, other than buildings, that add value to land. Examples of such improvements are fences, retaining walls, sidewalks, pavements, gutters, tunnels, and bridges. If the improvements are purchased or constructed, this account contains the purchase or contract price. If improvements are obtained by gift, it reflects the fair value at the time of acquisition. Site improvements are improvements that have a limited useful life. Because these improvements decrease in their value/usefulness over time, it is appropriate to depreciate these assets. Therefore, all capitalized site improvements should be depreciated over their expected useful life.", SortOrder=Convert.ToDecimal("29.00") },
