            new RefFinancialAccountBalanceSheetCode { Id=Guid.Parse("b4d71a10-7321-4040-92d9-da8a06d34147"), Code="512", Description="Accreted Interest", Definition="An account that represents interest that is accrued on deep discount bonds. This account should be used by school districts that issue capital appreciation bonds. Such bonds are usually issued at a deep discount from the face value, and no interest payment is made until maturity. Under full accrual accounting, the district is required to accrete the interest on the bonds over the life of the bonds. Accretion is the process of systematically increasing the carrying amount of the bond to its estimated value at the maturity date of the bond. To calculate accreted interest, the district should impute the effective interest rate, using the present value, the face value (or the future value), and the period of the bond, and multiply the effective interest rate by the book value of the debt at the end of the period. Accreted interest is usually recorded as an addition to the outstanding debt liability.", SortOrder=Convert.ToDecimal("67.00") },
            new RefFinancialAccountBalanceSheetCode { Id=Guid.Parse("eb375da0-7d47-4935-9ed8-5e7db32a7387"), Code="513", Description="Unamortized Gains/Losses on Debt Refundings", Definition="An account that represents the difference between the reacquisition price and the net carrying amount of old debt when a current or advance refunding of debt occurs. This account should be used only when defeasance of debt occurs for proprietary funds and entity-wide statements. The unamortized loss amount should be reported as a deferred outflow of resources and amortized as a component of interest expense in a systematic and rational manner over the remaining life of the old debt or the life of the new debt, whichever is shorter. The unamortized gain amount should be reported as a deferred inflow of resources and amortized as a component of interest expense in a systematic and rational manner over the remaining life of the old debt or the life of the new debt, whichever is shorter.", SortOrder=Convert.ToDecimal("68.00") },
