            new RefFinancialAccountBalanceSheetCode { Id=Guid.Parse("203a1d51-e4af-4f32-9177-d3e39668f232"), Code="561", Description="Arbitrage Rebate Liability", Definition="Liabilities arising from arbitrage rebates to the Internal Revenue Service (IRS) from bond financing.", SortOrder=Convert.ToDecimal("73.00") },
            new RefFinancialAccountBalanceSheetCode { Id=Guid.Parse("1d616c97-9a5b-48ce-972a-66ad833de1e5"), Code="590", Description="Other Long-Term Liabilities", Definition="Other long-term liabilities not provided for elsewhere. This account represents amounts due after more than 1 year from the balance sheet date for advances from other funds and certain miscellaneous liabilities, including workers' compensation, self-funded insurance, special termination benefits, and legal claims and judgments.", SortOrder=Convert.ToDecimal("74.00") },
            new RefFinancialAccountBalanceSheetCode { Id=Guid.Parse("e0c65804-a817-4f49-adf9-551a6f5b2cb4"), Code="600", Description="Deferred Inflows of Resources", Definition="An acquisition of net assets by the government that is applicable to a future reporting period. A deferred inflow of resources should be recognized when resources are received or recognized as a receivable before (a) the period for which property taxes are levied or (b) the period when the resources are required to be used. When an asset is recorded in governmental fund financial statements but the revenue is not available, the government should report a deferred inflow of resources until such time as the revenue becomes available.", SortOrder=Convert.ToDecimal("75.00") },
            new RefFinancialAccountBalanceSheetCode { Id=Guid.Parse("e3a9f27c-4aac-4b52-a3da-fa997de4b0a7"), Code="710", Description="Nonspendable Fund Balance", Definition="The nonspendable fund balance classification includes amounts that cannot be spent because they are either (a) not in spendable form or (b) legally or contractually required to be maintained intact. This would include items not expected to be converted to cash, including inventories and prepaid amounts. It may also include the long-term amount of loans and receivables, as well as property acquired for resale and the corpus (principal) of a permanent fund.", SortOrder=Convert.ToDecimal("76.00") },
