            new RefFinancialAccountBalanceSheetCode { Id=Guid.Parse("9bac3795-2e03-4635-8317-1b623f9f35b8"), Code="730", Description="Committed Fund Balance", Definition="The committed fund balance classification reflects specific purposes pursuant to constraints imposed by formal action at the district's highest level of decisionmaking authority (generally the governing board). Such constraints can only be removed or changed by the same form of formal action.", SortOrder=Convert.ToDecimal("78.00") },
            new RefFinancialAccountBalanceSheetCode { Id=Guid.Parse("e1b89e31-c1bc-4b2c-9ced-595bfe388ef8"), Code="740", Description="Assigned Fund Balance", Definition="The assigned fund balance classification reflects amounts that are constrained by the government's intent to be used for specific purposes, but meet neither the restricted nor committed forms of constraint. Also, the assigned fund balance classification is the residual classification for the special revenue, debt service, capital projects, and/or permanent funds after nonspendable, restricted, and committed balances have been identified (unless the residual amount is negative, which would require presentation as unassigned fund balance).", SortOrder=Convert.ToDecimal("79.00") },
            new RefFinancialAccountBalanceSheetCode { Id=Guid.Parse("344143d0-7357-4dd4-bbe9-edf538dc8b3e"), Code="750", Description="Unassigned Fund Balance", Definition="The unassigned fund balance classification is the residual classification, for the general fund only, after nonspendable, restricted, committed, and assigned balances have been identified. It is also used to report the residual amount for all other governmental funds after nonspendable, restricted, and committed balances have been identified, if the residual amount is negative.", SortOrder=Convert.ToDecimal("80.00") },
